INSERT INTO `news` (`id`, `title`, `path`, `content`, `isPost`, `image`, `user_id`, `created_at`, `updated_at`) VALUES
(1, 'Tính chất và ứng dụng của inox 304', 'tinh-chat-va-ung-dung-cua-inox-304', '<p><strong>Inox 304</strong><strong>&nbsp;(UNS S30400) được xem l&agrave; một c&acirc;u chuyện th&agrave;nh c&ocirc;ng nhất trong lịch sử ng&agrave;nh th&eacute;p kh&ocirc;ng gỉ (inox). N&oacute; chiếm hơn 50% tất cả c&aacute;c th&eacute;p kh&ocirc;ng gỉ được sản xuất. V&agrave; ở nhiều quốc gia inox 304 chiếm 50%-60% lượng th&eacute;p kh&ocirc;ng gỉ được ti&ecirc;u thụ v&agrave; sử dụng trong hầu hết c&aacute;c ứng dụng ở mọi lĩnh vực c&ocirc;ng nghiệp cũng như xuất hiện ở khắp mọi nơi xung quanh cuộc sống h&agrave;ng ng&agrave;y...</strong></p>\r\n\r\n<p><br />\r\n<img alt="" src="data:image/jpeg;base64," /></p>\r\n\r\n<p><br />\r\n<strong>304&nbsp;kh&ocirc;ng chỉ l&agrave;&nbsp;th&eacute;p&nbsp;kh&ocirc;ng gỉ&nbsp;m&agrave; c&ograve;n&nbsp;th&iacute;ch hợp&nbsp;trong mọi ứng dụng.&nbsp;Tuy nhi&ecirc;n,&nbsp;một&nbsp;sự hiểu biết về&nbsp;c&aacute;c thuộc t&iacute;nh của&nbsp;inox&nbsp;304sẽ cung cấp một cơ sở tốt&nbsp;cho việc so s&aacute;nh&nbsp;c&aacute;c th&agrave;nh vi&ecirc;n&nbsp;inox kh&aacute;c của gia đ&igrave;nh&nbsp;austenitic&nbsp;v&agrave;&nbsp;cơ sở&nbsp;thực tiễn&nbsp;đ&oacute;&nbsp;x&aacute;c định&nbsp;sự ph&ugrave; hợp của&nbsp;th&eacute;p&nbsp;kh&ocirc;ng gỉ&nbsp;trong&nbsp;một&nbsp;ứng dụng nhất định.<br />\r\n<br />\r\nLoại Inox 304L</strong>&nbsp;l&agrave; loại inox c&oacute; h&agrave;m lượng Carbon thấp (L - Low - Thấp).<strong>&nbsp;304L được d&ugrave;ng để tr&aacute;nh sự ăn m&ograve;n ở những mối h&agrave;n quan trọng</strong>. C&ograve;n loại Inox 304H l&agrave; loại c&oacute; h&agrave;m lượng Carbon cao hơn 304L, được d&ugrave;ng ở những nơi đ&ograve;i hỏi độ bền cao hơn. Cả Inox 304L v&agrave; 304H đều tồn tại ở dạng tấm v&agrave; ống, nhưng 304H th&igrave; &iacute;t được sản xuất.&nbsp;<br />\r\n<br />\r\n<strong>T&iacute;nh chống ăn m&ograve;n:&nbsp;</strong><br />\r\nInox 304 đ&atilde; thể hiện được khả năng chống ăn m&ograve;n tuyệt vời của m&igrave;nh khi được tiếp x&uacute;c với nhiều loại h&oacute;a chất kh&aacute;c nhau. Inox 304 c&oacute; khả năng chống gỉ trong hầu hết ứng dụng của ng&agrave;nh kiến tr&uacute;c, trong hầu hết c&aacute;c m&ocirc;i trường của qu&aacute; tr&igrave;nh chế biến thực phẩm v&agrave; rất dễ vệ sinh. Ngo&agrave;i ra,&nbsp;<strong>Inox 304 c&ograve;n thể hiện khả năng chống ăn m&ograve;n của m&igrave;nh trong ng&agrave;nh dệt nhuộm v&agrave; trong hầu hết c&aacute;c Acid v&ocirc; cơ.</strong><br />\r\n&nbsp;</p>\r\n\r\n<table border="0" cellpadding="1" cellspacing="2">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan="9">\r\n			<p><strong>Bảng 1: Th&agrave;nh phần h&oacute;a học của c&aacute;c d&ograve;ng Inox 304</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2">\r\n			<p><strong>M&aacute;c th&eacute;p</strong></p>\r\n			</td>\r\n			<td><strong>C%</strong></td>\r\n			<td><strong>Si%</strong></td>\r\n			<td><strong>Mn%</strong></td>\r\n			<td><strong>P%</strong></td>\r\n			<td><strong>S%</strong></td>\r\n			<td><strong>Cr%</strong></td>\r\n			<td><strong>Ni%</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>UNS S30400</td>\r\n			<td>304</td>\r\n			<td>0.08</td>\r\n			<td>1.00</td>\r\n			<td>2.00</td>\r\n			<td>0.045</td>\r\n			<td>0.03</td>\r\n			<td>18.0-20.0</td>\r\n			<td>8.0-10.5</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="9">\r\n			<p><em>Một số d&ograve;ng th&eacute;p c&ugrave;ng loại</em></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>UNS S30403</td>\r\n			<td>304L</td>\r\n			<td>0.03</td>\r\n			<td>1.00</td>\r\n			<td>2.00</td>\r\n			<td>0.045</td>\r\n			<td>0.03</td>\r\n			<td>18.0-20.0</td>\r\n			<td>8.0-12.0</td>\r\n		</tr>\r\n		<tr>\r\n			<td>UNS S30409</td>\r\n			<td>304H</td>\r\n			<td>0.04-0.10</td>\r\n			<td>1.00</td>\r\n			<td>2.00</td>\r\n			<td>0.045</td>\r\n			<td>0.03</td>\r\n			<td>18.0-20.0</td>\r\n			<td>8.0-12.0</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="9">\r\n			<p>1. Những gi&aacute; trị đơn l&agrave; giới hạn ti&ecirc;u chuẩn tối đa.<br />\r\n			2. C&aacute;c giới hạn n&agrave;y được quy định trong ti&ecirc;u chuẩn ASTM A240 cho tấm, cuộn v&agrave; la inox. Th&ocirc;ng số kỹ thuật cho một số sản phẩm kh&aacute;c c&oacute; thể thay đổi ch&uacute;t &iacute;t so với c&aacute;c gi&aacute; trị đ&oacute;.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><br />\r\n<strong>Khả năng chịu nhiệt:</strong><br />\r\nInox 304 c&oacute; khả năng chống oxi h&oacute;a tốt ở nhiệt độ 870 độ C, v&agrave; tiếp tục thể hiện được l&ecirc;n đến nhiệt độ 925 độ C Trong những trường hợp y&ecirc;u cầu độ bền nhiệt cao, th&igrave; người ta y&ecirc;u cầu vật liệu c&oacute; h&agrave;m lượng carbon cao hơn. V&iacute; dụ: Theo ti&ecirc;u chuẩn giới hạn nhiệt độ hoạt đ&ocirc;ng AS1210 của inox 304L l&agrave; 425 độ C, v&agrave; hạn chế sử dụng inox 304 với h&agrave;m lượng carbon 0.04% hoặc cao hơn tr&ecirc;n nhiệt độ 550 độ C.<br />\r\n&nbsp;</p>\r\n\r\n<table border="0" cellpadding="1" cellspacing="2" style="height:302px; width:643px">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan="2">\r\n			<p><strong>Bảng 2: Thuộc t&iacute;nh cơ kh&iacute; của d&ograve;ng inox 304</strong></p>\r\n\r\n			<p><strong>(t&igrave;nh trạng t&ocirc;i luyện) theo ti&ecirc;u chuẩn ASTM A240M</strong></p>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n			<td colspan="2">\r\n			<p><strong>Bảng 3: T&iacute;nh chất vật l&yacute; của d&ograve;ng inox 304 (gi&aacute; trị đặc trưng trong t&igrave;nh trạng t&ocirc;i luyện)</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Sức căng</td>\r\n			<td>515MPa min</td>\r\n			<td>&nbsp;</td>\r\n			<td>Tỷ trọng</td>\r\n			<td>8,000kg/m&nbsp;<sup>3</sup></td>\r\n		</tr>\r\n		<tr>\r\n			<td>0.2% ứng suất bền</td>\r\n			<td>205MPa min</td>\r\n			<td>&nbsp;</td>\r\n			<td>Suất đ&agrave;n hồi</td>\r\n			<td>193GPa</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Độ gi&atilde;n d&agrave;i</td>\r\n			<td>40% min</td>\r\n			<td>&nbsp;</td>\r\n			<td colspan="2">\r\n			<p>Hệ số gi&atilde;n nở nhiệt</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Độ cứng Brinell</td>\r\n			<td>201HB max</td>\r\n			<td>&nbsp;</td>\r\n			<td>0-100<sup>o</sup>C</td>\r\n			<td>17.2&micro;m/m/&nbsp;<sup>o</sup>C</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Độ cứng Rockwell</td>\r\n			<td>92HRB max</td>\r\n			<td>&nbsp;</td>\r\n			<td>0-315<sup>o</sup>C</td>\r\n			<td>17.8&micro;m/m/&nbsp;<sup>o</sup>C</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Độ cứng Vickers</td>\r\n			<td>210HV max</td>\r\n			<td>&nbsp;</td>\r\n			<td>0-538<sup>o</sup>C</td>\r\n			<td>18.4&micro;m/m/&nbsp;<sup>o</sup>C</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2">\r\n			<p>Ghi ch&uacute;: Những t&iacute;nh chất kh&aacute;c nhau được đưa ra trong&nbsp;th&ocirc;ng<br />\r\n			số kỹ thuật kh&aacute;c.</p>\r\n			</td>\r\n			<td>&nbsp;</td>\r\n			<td colspan="2">\r\n			<p>Độ dẫn nhiệt</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="3">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td>at 100<sup>o</sup>C</td>\r\n			<td>16.2W/m.K</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="3">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td>at 500<sup>o</sup>C</td>\r\n			<td>21.5W/m.K</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="3">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td>Nhiệt dung ri&ecirc;ng 0-100<sup>o</sup>C</td>\r\n			<td>500J/kg.K</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="3">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td>Độ dẫn điện</td>\r\n			<td>720nOhms.m</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><br />\r\nInox 304 thể hiện khả năng dẻo dai tuyệt vời khi được hạ đến nhiệt độ của kh&iacute; h&oacute;a lỏng v&agrave; người ta đ&atilde; t&igrave;m thấy những ứng dụng tại những nhiệt độ n&agrave;y.<br />\r\n<br />\r\nGiống như c&aacute;c loại th&eacute;p trong d&ograve;ng Austenitic, th&igrave;&nbsp;<strong>từ t&iacute;nh của Inox 304 l&agrave; rất yếu</strong>&nbsp;v&agrave; hầu như l&agrave; kh&ocirc;ng c&oacute;. Nhưng sau&nbsp;<strong>khi l&agrave;m việc trong m&ocirc;i trường c&oacute; nhiệt độ thấp, th&igrave; từ t&iacute;nh lại rất mạnh</strong>&nbsp;(điều n&agrave;y đi ngược lại với qu&aacute; tr&igrave;nh t&ocirc;i).</p>\r\n\r\n<p><br />\r\n<img alt="" src="http://inoxquangminh.com/upload/image_upload/luyen%20thep%20small.jpg" style="height:451px; width:632px" /><br />\r\n&nbsp;</p>\r\n\r\n<p>V&agrave; cũng giống như d&ograve;ng th&eacute;p austenitic kh&aacute;c, inox 304 chỉ c&oacute; thể được l&agrave;m cứng bằng c&aacute;ch l&agrave;m lạnh. Độ cứng căng d&atilde;n tối đa trong giới hạn của Inox 304 c&oacute; thể đạt được l&agrave; 1000MPa, điều n&agrave;y c&ograve;n được ảnh hưởng bởi c&aacute;c yếu tố như số lượng v&agrave; h&igrave;nh dạng của vật liệu.&nbsp;<br />\r\n<br />\r\nT&ocirc;i l&agrave; phương ph&aacute;p ch&iacute;nh để sản xuất ra Inox 304. Điều n&agrave;y được thực hiện bằng c&aacute;ch nung n&oacute;ng l&ecirc;n đến 1010 độ C &ndash; 1120 độ C, v&agrave; sau đ&oacute; nhanh ch&oacute;ng l&agrave;m m&aacute;t - thường l&agrave; bằng phương ph&aacute;p l&agrave;m nguội bằng nước lạnh.<br />\r\n<br />\r\n<strong>Khả năng gia c&ocirc;ng</strong><br />\r\n<br />\r\nInox 304 c&oacute; khả năng tạo h&igrave;nh rất tốt, n&oacute;&nbsp;<strong>c&oacute; thể d&aacute;t mỏng m&agrave; kh&ocirc;ng cần gia nhiệt</strong>. Điều n&agrave;y l&agrave;m cho Inox n&agrave;y độc quyền trong lĩnh vực sản xuất c&aacute;c chi tiết Inox.&nbsp;<br />\r\n<strong>V&iacute; dụ:</strong>&nbsp;chậu rửa, chảo, nồi&hellip; Ngo&agrave;i ra, t&iacute;nh chất n&agrave;y c&ograve;n l&agrave;m cho Inox 304 được ứng dụng l&agrave;m d&acirc;y thắng trong c&ocirc;ng nghiệp v&agrave; c&aacute;c phương tiện như &ocirc; t&ocirc;, xe m&aacute;y, xe đạp&hellip;</p>\r\n\r\n<p><br />\r\n<br />\r\n<img alt="" src="data:image/jpeg;base64," style="height:519px; width:623px" />&nbsp;</p>\r\n\r\n<p><br />\r\nInox 304 thể hiện khả năng h&agrave;n tuyệt vời, loại inox n&agrave;y ph&ugrave; hợp với tất cả c&aacute;c kỹ thuật h&agrave;n (trừ kỹ thuật h&agrave;n gi&oacute; đ&aacute;). Khả năng cắt gọt của Inox 304 k&eacute;m hơn so với c&aacute;c loại th&eacute;p Carbon, khi gia c&ocirc;ng vật liệu n&agrave;y tr&ecirc;n c&aacute;c m&aacute;y c&ocirc;ng cụ, th&igrave; phải y&ecirc;u cầu tốc độ quay thấp, qu&aacute;n t&iacute;nh lớn, dụng cụ cắt phải cứng, b&eacute;n v&agrave; kh&ocirc;ng qu&ecirc;n d&ugrave;ng nước l&agrave;m m&aacute;t.<br />\r\n<br />\r\n<strong>So s&aacute;nh chi ph&iacute;</strong><br />\r\n<br />\r\n&quot;Chi ph&iacute; ban đầu&quot; của so s&aacute;nh chi ph&iacute; chỉ c&oacute; thể l&agrave; tương đối, nhưng c&aacute;c hướng dẫn trong Bảng 4 được đề xuất cho tấm vật liệu sau khi được xuất xưởng từ nh&agrave; m&aacute;y ti&ecirc;u với chuẩn ph&ugrave; hợp cho c&aacute;c dự &aacute;n x&acirc;y dựng. Th&ocirc;ng số chi ph&iacute; v&ograve;ng đời, trong nhiều ứng dụng, l&agrave;m tăng đ&aacute;ng kể sự hấp dẫn của th&eacute;p kh&ocirc;ng gỉ (Inox) so với đối thủ cạnh tranh l&agrave; chi ph&iacute; ban đầu của n&oacute;.<br />\r\n&nbsp;</p>\r\n\r\n<table border="0" cellpadding="1" cellspacing="2">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan="2">\r\n			<p><strong>Bảng 4: So s&aacute;nh chi ph&iacute; đầu ti&ecirc;n</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Vật liệu</strong></td>\r\n			<td><strong>Gi&aacute; xấp xỉ ($USD/kg)</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>K&iacute;nh (trong suốt)</td>\r\n			<td>0.2</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Th&eacute;p nhẹ</td>\r\n			<td>1.0-1.5</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Th&eacute;p mạ kẽm nh&uacute;ng n&oacute;ng.&nbsp;</td>\r\n			<td>1.5-2.5</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>Inox 304</strong></td>\r\n			<td><strong>4.0-5.0</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Hợp kim nh&ocirc;m (đ&atilde; được &eacute;p)</td>\r\n			<td>4.0-5.5</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Inox 316</td>\r\n			<td>5.0-6.0</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Mạ đồng</td>\r\n			<td>8.0</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Đồng thau</td>\r\n			<td>8.5</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Đồng thiếc</td>\r\n			<td>10.0</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="2">\r\n			<p>Nguồn: kỹ sư tư vấn Facet, Brisbane</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><br />\r\n<strong><strong>C&aacute;c h&igrave;nh th&aacute;i sẵn c&oacute;</strong></strong><br />\r\n<br />\r\nInox 304 c&oacute; sẵn hầu hết trong c&aacute;c h&igrave;nh thức sản phẩm của th&eacute;p kh&ocirc;ng gỉ (inox), bao gồm ống inox, tấm inox, cuộn inox, dải inox, đường ống inox, thanh inox, phụ kiện inox, inox d&acirc;n dụng, c&aacute;c sản phẩm inox sử dụng trong nh&agrave; bếp, d&acirc;y điện, ốc v&iacute;t, ống đ&uacute;c inox v&agrave; nhiều sản phẩm kh&aacute;c. Inox 304 cũng xuất hiện hầu như tr&ecirc;n tất cả c&aacute;c sản phẩm đ&atilde; ho&agrave;n thiện của bề mặt inox, từ dạng ti&ecirc;u chuẩn đến những t&iacute;nh chất kỹ thuật đặc biệt .<br />\r\n<br />\r\n<strong>Ứng dụng</strong><br />\r\n<br />\r\nC&aacute;c lớp thay thế cho inox 304 n&ecirc;n được xem x&eacute;t trong m&ocirc;i trường nhất định v&agrave; c&aacute;c ứng dụng của n&oacute;, bao gồm trong điều kiện h&agrave;ng hải, m&ocirc;i trường c&oacute; nhiệt độ tr&ecirc;n 50-60oC v&agrave; với clorua như hiện tại, cũng như c&aacute;c ứng dụng đ&ograve;i hỏi h&agrave;n phần nặng, độ gia c&ocirc;ng kh&oacute;, cường độ cao hoặc độ cứng lớn, hoặc dải inox với độ cuốn lạnh cao.</p>\r\n\r\n<p><br />\r\n<img alt="" src="data:image/jpeg;base64," style="height:473px; width:631px" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tuy nhi&ecirc;n, c&aacute;c ứng dụng v&agrave; sản phẩm điển h&igrave;nh cho inox 304 bao gồm b&aacute;t, đĩa, cốc, ch&eacute;n, xoong, nồi , kiến ​​tr&uacute;c, thực phẩm, chế biến nước giải kh&aacute;t, thiết bị v&agrave; đồ d&ugrave;ng, x&acirc;y dựng nh&agrave; bếp thương mại trong v&agrave; ngo&agrave;i nước, chậu rửa, v&agrave; thực vật đối với h&oacute;a chất, h&oacute;a dầu, chế biến kho&aacute;ng sản v&agrave; c&aacute;c ng&agrave;nh c&ocirc;ng nghiệp kh&aacute;c.<br />\r\n<br />\r\nVới sự phổ biến rộng r&atilde;i n&agrave;y, inox 304 đ&atilde; trở th&agrave;nh một hợp kim cơ bản trong ng&agrave;nh c&ocirc;ng nghiệp hiện đại v&agrave; chắc chắn c&oacute; gi&aacute; trị cho nền tảng kiến thức về ng&agrave;nh vật liệu của bạn.<br />\r\n&nbsp;</p>\r\n\r\n<table border="0" cellpadding="1" cellspacing="2">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan="7"><strong>Bảng 5: Một số k&yacute; hiệu tương đương gần đ&uacute;ng</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="7">\r\n			<p><strong>Sản phẩm r&egrave;n</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Cơ bản</td>\r\n			<td>UNS</td>\r\n			<td>ASTM</td>\r\n			<td>&nbsp;Anh Quốc</td>\r\n			<td>Đức</td>\r\n			<td>Thụy Điển</td>\r\n			<td>&nbsp;Nhật Bản</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Th&ocirc;ng số kỹ thuật</td>\r\n			<td>S30400</td>\r\n			<td>304</td>\r\n			<td>BS 304S15&nbsp;&nbsp;&nbsp;<br />\r\n			En 58E</td>\r\n			<td>W. No 1.4301<br />\r\n			DIN X5CrNi 18 9</td>\r\n			<td>SS 2332</td>\r\n			<td>JIS SUS 304</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="7">\r\n			<p><strong>Sản phẩm đ&uacute;c</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Cơ bản</td>\r\n			<td>UNS</td>\r\n			<td>ASTM</td>\r\n			<td>BS3100</td>\r\n			<td>Đức</td>\r\n			<td>AS2074</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Th&ocirc;ng số kỹ thuật</td>\r\n			<td>J92600</td>\r\n			<td>A743 CF-8</td>\r\n			<td>304C15</td>\r\n			<td>STD No. 4308<br />\r\n			DIN G-X6CrNi 18 9</td>\r\n			<td>H5A</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan="7">Ghi ch&uacute;: Đối với c&aacute;c ốc v&iacute;t sản xuất theo ISO3506, inox 304 đ&atilde; được đ&iacute;nh k&egrave;m trong k&yacute; hiệu &#39;A2&#39;.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', 1, 'images/uploads/images/tintucs/dac-tinh-inox-304.jpg', 1, '2017-09-17 14:11:00', '2017-09-17 14:11:00');

