(7, 'TẤM INOX CHỐNG TRƯỢT', 'tam-inox-chong-truot', 1, 'images/uploads/images/sanphams/870312320046_265x198.30833333333.jpg', '<p><em><strong>Tấm Inox chống trượt, hay c&ograve;n gọi l&agrave; tấm inox dập g&acirc;n thường được d&ugrave;ng trong c&aacute;c c&ocirc;ng tr&igrave;nh cao ốc, nh&agrave; m&aacute;y l&agrave;m bậc cầu thang, l&oacute;t s&agrave;n nh&agrave; m&aacute;y...để đảm bảo an to&agrave;n cho việc di chuyển v&agrave; thao t&aacute;c của c&ocirc;ng nh&acirc;n.</strong></em></p>\r\n\r\n<p><strong><em>-Tấm Inox chống trượt đ&uacute;c (nhập khẩu)</em></strong></p>\r\n\r\n<p><strong><em><em>&nbsp; Xuất xứ: Đ&agrave;i Loan, H&agrave;n Quốc, T&acirc;y Ban Nha&nbsp;</em></em></strong></p>\r\n\r\n<p><strong><em>-Tấm Inox chống trượt dập (trong nước)</em></strong></p>\r\n\r\n<p><em><strong>Độ dầy từ 2mm - 5mm</strong></em></p>\r\n\r\n<p><em><strong>Khổ (1000 - 1500)mm x (2000 - 3000)mm</strong></em></p>\r\n\r\n<p><em><strong>Ngo&agrave;i ra ch&uacute;ng t&ocirc;i c&ograve;n cung cấp c&aacute;c loại tấm inox dạng lưới, inox tấm đục lỗ tr&ograve;n, elip, ..., nhiều k&iacute;ch thước kh&aacute;c nhau theo y&ecirc;u cầu của kh&aacute;ch h&agrave;ng.</strong></em></p>', 5, 1, 18, '2017-09-18 08:38:48', '2017-09-18 08:38:48'),
